INSERT INTO `wp_posts` VALUES (4,1,'2016-01-19 17:27:45','2016-01-19 14:27:45','','Добрый день, что будем печатать?','','publish','closed','closed','','shop','','','2016-02-01 13:21:03','2016-02-01 10:21:03','',0,'http://t9z.su/shop/',0,'page','',0),(5,1,'2016-01-19 17:27:45','2016-01-19 14:27:45','<h1>Ваши товары в корзине</h1>\r\n[woocommerce_cart]','Ваши товары в корзине','','publish','closed','closed','','cart','','','2016-02-12 15:57:58','2016-02-12 12:57:58','',0,'http://t9z.su/cart/',0,'page','',0),(6,1,'2016-01-19 17:27:45','2016-01-19 14:27:45','[woocommerce_checkout]','Checkout','','publish','closed','closed','','checkout','','','2016-02-12 16:10:33','2016-02-12 13:10:33','',0,'http://t9z.su/checkout/',0,'page','',0),(7,1,'2016-01-19 17:27:45','2016-01-19 14:27:45','[woocommerce_my_account]','My Account','','publish','closed','closed','','my-account','','','2016-02-15 22:31:28','2016-02-15 19:31:28','',0,'http://t9z.su/my-account/',0,'page','',0),(15,1,'2016-01-22 02:03:16','2016-01-21 23:03:16','<div class=\"about-text\">\r\n<h1>О компании</h1>\r\nМы все распечатаем, остается решить на какой стене разместить новые фото.\r\n\r\nПечать фотографий осуществляется на новейшем оборудовании с использованием современных технологий и фирменных материалах. Поэтому снимки сохраняют качество в течение достаточно длительного периода времени.\r\n\r\nКлиентами нашей лаборатории являются, как профессиональные фотографы, так и любители. Всем, кто занимается фотографией на профессиональном уровне, предлагаем взаимовыгодные условия сотрудничества.\r\n\r\nРаспечатка фотографий выполняется качественно и быстро.\r\n\r\n</div>','О компании','','publish','closed','closed','','o-kompanii','','','2016-02-09 20:12:36','2016-02-09 17:12:36','',0,'http://t9z.su/?page_id=15',0,'page','',0),(16,1,'2016-01-22 02:03:16','2016-01-21 23:03:16','','О компании','','inherit','closed','closed','','15-revision-v1','','','2016-01-22 02:03:16','2016-01-21 23:03:16','',15,'http://t9z.su/2016/01/22/15-revision-v1/',0,'revision','',0),(17,1,'2016-01-22 02:03:31','2016-01-21 23:03:31','<div class=\"wrap\"><h1>Вопросы и ответы</h1></div>\r\n<div class=\"qa-text\">\r\n<div class=\"wrap\">\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Как быстро выполняется заказ? И нужно ли доплачивать за срочность?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Rerum, hic minima, vero ex facere fugiat. Dolorum incidunt doloremque sed alias. Hic libero dolores repellendus fugit, dignissimos perspiciatis. Tempora molestiae, adipisci!\r\n\r\nAutem quis impedit quos quam, alias ad, voluptatum architecto eum minima ipsa, nemo in vero odio nam sit molestiae vitae provident illo, quia quidem dignissimos magnam! Laudantium, facere, voluptatibus. Voluptas?\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">На каком оборудовании вы печатаете? Это не домашний принтер?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nТрадиционная печать фотографий осуществляется на профессиональном HI-End фотопринтере Durst Theta 76. По сравнению со стандартными минифотолабораториями любых производителей, Durst Theta 76 обладает большим хроматическим охватом т.е. передает большее количество цветов. Изображения, напечатанные на этом принтере, обладают большим фотометрическим контрастом, благодаря этому фотографии выглядят более естественными и с правильной цветопередачей.\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Есть ли ограничение по количеству?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatum necessitatibus nemo mollitia ex itaque natus, nesciunt perferendis magni minus amet sequi provident consequatur velit ipsum repellendus, enim eaque quae dignissimos.\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Как есть способы доставки заказа? Доставляете ли по регионам?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Fugiat a nobis rem, facilis assumenda molestiae. Libero dolores voluptatum aspernatur quasi architecto, voluptatem nulla, labore ex nostrum ullam illum consequuntur odio.\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Есть ли гарантия на ваши работы, что фото будет долговечным?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Dolores sequi est, illo reiciendis rem illum nulla sed voluptate, saepe, error consequatur culpa atque tempore. Expedita ad maxime enim nesciunt nihil.\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Можно ли оплатить наличными, когда я убежусь что все качественно сделано?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Consectetur voluptatibus quae, quam dolores, non nisi iure possimus animi temporibus quisquam consequuntur tempora recusandae beatae eius. Error maxime est, tempore nisi.\r\n\r\nVeniam eos ad nemo quia quod at vel ab quibusdam, non, sint ullam praesentium nihil necessitatibus esse doloremque, mollitia ipsam obcaecati architecto magni itaque. Adipisci totam deserunt tempore quae debitis.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Вопросы и ответы','','publish','closed','closed','','qa','','','2016-02-09 20:37:17','2016-02-09 17:37:17','',0,'http://t9z.su/?page_id=17',0,'page','',0),(18,1,'2016-01-22 02:03:31','2016-01-21 23:03:31','','Вопросы и ответы','','inherit','closed','closed','','17-revision-v1','','','2016-01-22 02:03:31','2016-01-21 23:03:31','',17,'http://t9z.su/2016/01/22/17-revision-v1/',0,'revision','',0),(21,1,'2016-01-22 02:03:47','2016-01-21 23:03:47','','Контакты','','publish','closed','