closed','closed','','kontaktnaya-forma-1','','','2016-02-26 17:49:53','2016-02-26 14:49:53','',0,'http://t9z.su/?post_type=wpcf7_contact_form&#038;p=109',0,'wpcf7_contact_form','',0),(113,1,'2016-02-09 20:12:36','2016-02-09 17:12:36','<div class=\"about-text\">\r\n<h1>О компании</h1>\r\nМы все распечатаем, остается решить на какой стене разместить новые фото.\r\n\r\nПечать фотографий осуществляется на новейшем оборудовании с использованием современных технологий и фирменных материалах. Поэтому снимки сохраняют качество в течение достаточно длительного периода времени.\r\n\r\nКлиентами нашей лаборатории являются, как профессиональные фотографы, так и любители. Всем, кто занимается фотографией на профессиональном уровне, предлагаем взаимовыгодные условия сотрудничества.\r\n\r\nРаспечатка фотографий выполняется качественно и быстро.\r\n\r\n</div>','О компании','','inherit','closed','closed','','15-revision-v1','','','2016-02-09 20:12:36','2016-02-09 17:12:36','',15,'http://t9z.su/2016/02/09/15-revision-v1/',0,'revision','',0),(114,1,'2016-02-09 20:36:12','2016-02-09 17:36:12','<h1>Вопросы и ответы</h1>\r\n<div class=\"qa-text\">\r\n<div class=\"wrap\">\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">Как быстро выполняется заказ? И нужно ли доплачивать за срочность?</span></div>\r\n<div class=\"qa-descr\">\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Rerum, hic minima, vero ex facere fugiat. Dolorum incidunt doloremque sed alias. Hic libero dolores repellendus fugit, dignissimos perspiciatis. Tempora molestiae, adipisci!\r\n\r\nAutem quis impedit quos quam, alias ad, voluptatum architecto eum minima ipsa, nemo in vero odio nam sit molestiae vitae provident illo, quia quidem dignissimos magnam! Laudantium, facere, voluptatibus. Voluptas?\r\n\r\n</div>\r\n</div>\r\n<div class=\"qa-item\">\r\n<div class=\"qa-title\"><span class=\"pseudo-link\">На каком оборудовании вы печатаете? Это не домашний принтер?</span></div>\r\n